Was a tough time on the golf course last week. A quick hike in Zion will put things in perspective. We are so small in this big 🌎 Shoutout to my hubby for always keeping my chin up. Back to work to sort things out in my game👊🏻

Thank you @copperrock for hosting a world-class event. Thank you to all the volunteers for your time and enthusiasm. Always one of the best stops! 

